import React, { Component } from "react";
import Projects from "../tools/projects";
class Nav extends Component {
  state = {};
  //   expand = e => {
  //     if (this.state.isExpanded === false) this.setState({ isExpanded: true });
  //     else this.setState({ isExpanded: false });
  //   };
  render() {
    const openNavStyle = {
      width: "200px",
      textAlign: "initial"
    };
    const closeNavStyle = {
      width: "50px"
    };
    return (
      <React.Fragment>
        <div
          className="sideNav"
          style={this.state.isExpanded ? openNavStyle : closeNavStyle}
        >
          <Projects
            expand={this.expand}
            isExpanded={this.state.isExpanded}
            handleProjects={this.props.handleProjects}
            viewProject={this.props.viewProject}
          />
        </div>
      </React.Fragment>
    );
  }
}

export default Nav;
